import React, { Component } from 'react';


class Formulario extends Component {

    constructor() {
        this.data = "";
        this.hora = "";
        this.minuto = "";
    }

    handleMudancaData(evento) {
        this.data = evento.target.value;
    }

    submitFormulario() {
        console.log("Submitou");
    }

    render() {
        return (
            <form onSubmit={this.submitFormulario}>
                <input type="data" placeholder="data" onChange={ this.handleMudancaData } />
                <input type="text" placeholder="hora" />
                <input type="text" placeholder="mins" />
                <button>Criar</button>
            </form>
        );
    }
}

export default Formulario;
